    <!-- Поле для ввода пароля -->
    <rect x="213.5" y="582.5" width="282" height="37" rx="18.5" stroke="#6A6767" fill="white"/>
    <foreignObject x="213.5" y="582.5" width="282" height="37">

    <!-- Кнопка отправки -->
    <rect x="214" y="674" width="153" height="35" rx="17.5" fill="#EAEF1D" onclick="submitForm()" style="cursor: pointer;"/>

    <script>
        function submitForm() {
            const fullName = document.getElementById('full_name').value;
            const email = document.getElementById('email').value;
            const password = document.getElementById('password').value;

            if (!fullName || !email || !password) {
                alert('Пожалуйста, введите все данные.');
                return;
            }

            const data = {
                full_name: fullName,
                email: email,
                password: password
            };

            console.log('Sending data:', data);

            fetch('http://localhost:8080/registr1', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            })
                .then(response => response.json())
                .then(data => {
                    console.log('Success:', data);
                    alert('Регистрация прошла успешно!');
                    window.location.href = '/'; // Замените на URL вашей страницы
                })
                .catch((error) => {
                    console.error('Error:', error);
                    alert('Произошла ошибка при регистрации.');
                });
        }
